import sys

class VDOM_carousel(VDOM_object):

	def render(self, parent, contents=""):
		display = u"display:none;" if self.visible == "0" else u""

		style_zindex = u"z-index:%s;" % self.zindex if int(self.zindex) <> 0 else u""

		style = u"""{display} {zind} position: {pos}; top: {top}px; left: {left}px;
					width: {width}px; height: {height}px; """\
				.format(display = display, zind = style_zindex, pos = self.position,
						top = self.top, left = self.left, width = self.width, height = self.height)
		id = u"o_" + (self.id).replace('-', '_')
		idin = id + u"-inner"

		if VDOM_CONFIG_1["DEBUG"] == "1":
			debug_info = u"objtype='carousel' objname='%s' ver='2011-12-02'" % self.name
		else:
			debug_info = u""

		data = self.data % { "id": idin }

		if self.direction == '1':
			dir = 'right'
		elif self.direction == '2':
			dir = 'up'
		elif self.direction == '3':
			dir = 'down'
		else:
			dir = 'left'

		classname = u"""class="%s" """ % self.classname if self.classname else u""

		if self.custominit != "":
			custom_init = self.custominit
		else:
			custom_init = u"""
		items: %(items)s,
		direction: "%(dir)s",
		scroll: {
			items: %(items)s,
			duration: %(duration)s,
			pauseOnHover: true
		}
			""" % { "dir": dir, "items": int(self.itemscount), "duration": int(self.duration) }

		result = u"""<div %(debug_info)s id="%(id)s" style="%(style)s" %(classname)s>%(data)s</div>
<script type="text/javascript">
jQuery(function($){
	$("#%(idin)s").carouFredSel({
		%(custom_init)s
	});
});
</script>""" % { "debug_info": debug_info, "id": id, "idin": idin, "style": style, "classname": classname,
			"data": data, "custom_init": custom_init }

		return VDOM_object.render(self, parent, contents=result)


	def wysiwyg(self, parent, contents=""):

		result = u"""<container id="{id}" visible="{vis}" zindex="{zind}" hierarchy="{hierarchy}" order="{order}"
							top="{top}" left="{left}" width="{width}" height="{height}">
						<svg>
							<rect x="0" y="0" width="{width}" height="{height}" fill="#EEEEEE"/>
						</svg>
						{contents}
					</container>
				""".format(id = self.id, vis = self.visible, zind = self.zindex,
							hierarchy = self.hierarchy, order = self.order,
							top = self.top, left = self.left, width = self.width, height = self.height,
							contents = contents)

		return VDOM_object.wysiwyg(self, parent, contents=result)
